import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { decrement, increment, changeValue } from 'redux/counter/counterSlice';

import { ButtonStyled, TextFieldStyled } from 'components/CommonComponents';
import { themeContext } from 'context/themeContext';
import { useContext } from 'react';

export default function Counter() {
  const { mainTheme } = useContext(themeContext);
  const count = useSelector(state => state.counter.value);
  const dispatch = useDispatch();

  return (
    <div>
      <ButtonStyled
        colors={mainTheme.colors}
        onClick={() => dispatch(changeValue(1))}
      >
        Increase
      </ButtonStyled>
      <span style={{ fontSize: '25px', margin: '30px' }}>{count}</span>
      <ButtonStyled
        colors={mainTheme.colors}
        onClick={() => dispatch(changeValue(-1))}
      >
        Decrease
      </ButtonStyled>
      <TextFieldStyled colors={mainTheme.colors} size="large" type="number" />
    </div>
  );
}
